Creating Aggregation Stage to Total Number of Open Transactions in MongoDB Collection<p>One of the steps I'm using in my MongoDB aggregation pipeline looks like this:</p>

<pre><code>{
  $group: {
    "_id": "$customer._id",
    "totalBalance": {
      "$sum": "$transactions.amounts.balance"
    }
  }
}
</code></pre>

<p>This is working as expected. It sums up the numerical values for <code>transactions.amounts.balance</code> and gives me the total dollar amount.</p>

<p>What I'd like to do in addition to this is determine how many transactions are used in determining this number (i.e., determine how many records there are for a given <code>customer_id</code> where the <code>transactions.amount.balance &gt; 0</code>.</p>

<p>I've tried doing this:</p>

<pre><code>{
  $group: {
    "_id": "$customer._id",
    "totalOpenTransactions": {
      "$sum": { "$transactions.amounts.balance" : $gt: 0 }
    }
  }
}
</code></pre>

<p>The above didn't work. So I also tried using an array, like this:</p>

<pre><code>{
  $group: {
    "_id": "$customer._id",
    "totalOpenTransactions": {
      "$sum": [{ "$transactions.amounts.balance" : $gt: 0 }]
    }
  }
}
</code></pre>

<p>Also doesn't work.</p>

<p>Can <code>$sum</code> be used like this? Or do I need to approach this particular aggregation stage differently?</p>

