I am able to connect to MongoDB and send and receive messages. 
<strong>Issue</strong> : But when I open the app on my phone browser using the PC IP address (e.g. 192.168.1.108:4000). I can see the index.html page , but unable to send and receive messages and load previous messages from mongodb.</p>

